import 'bootstrap/dist/css/bootstrap.min.css';
import required_ics from '../assets/icsrequirements';

const Requirements = () => {
    let count = 0;
    for(var key in required_ics)
    {
        console.log(key)
    }

    function check_tag(item)
    {
        count += 1;
        if(required_ics[item])
        {
            return <li key={count}>{item}</li>
        }
        return <h3 key={count}>{required_ics[item]}</h3>
    }
    return (
        <ul>
            {Object.keys(required_ics).map((key, value) => (
                check_tag(key)
            ))}

        </ul>
    )
}

export default Requirements
